import { createAsyncThunk, createSlice } from "@reduxjs/toolkit";
import { client } from "../../api/client";
import configData from "../../config.json"

const initialState = {
	diagrams: [],
	errors: []
};

export const postConfig = createAsyncThunk(
  'visualization/postConfig',
  async (nevisAuthConfig) => {
    const response = await client.post(configData.SERVER_URL + '/visualise/nevisAuth', { nevisAuthConfig: nevisAuthConfig });
    return response.data;
  }
)

const visualizationSlice = createSlice({
	name: 'visualization',
	initialState,
	reducers: {
		visualize(state) {
			state.diagrams.push('data:image/jpeg;base64,');
		},
		clear(state) {
			state.diagrams = [];
		}
	},
	extraReducers(builder) {
		builder
      .addCase(postConfig.fulfilled, (state, action) => {
      	state.diagrams = [];
      	state.diagrams.push(...action.payload);
      })
      .addCase(postConfig.rejected, (state, action) => {
      	state.errors = [];
      	state.errors.push(...action.payload);
      });
	}
});

export const selectDiagrams = (state) => state.visualization.diagrams;
export const { visualize, clear } = visualizationSlice.actions;
export default visualizationSlice.reducer;
